0.ds_documentacao:
I.	Cadastro Acadêmico, disponível a partir do dia 29 de janeiro de 2018, às 17h na página eletrônica http://coc.unifesspa.edu.br, preenchido, impresso, assinado, datado e com 01 (uma) foto 3 x 4 recente colada no campo destinado para essa finalidade. 
II.	Cédula de Identidade (RG);
III.	CPF - Dispensável caso a Carteira de Identidade já contenha o número do CPF; 
IV.	Título de Eleitor e comprovante de que está em dia com as obrigações eleitorais (apresentação dos dois últimos comprovantes de votação ou declaração de quitação eleitoral) ¿ Obrigatório para maiores de 18 anos; 
V.	Prova de estar em dia com as obrigações relativas ao serviço militar. Exigida apenas para os candidatos do sexo masculino, maiores de 18 anos de idade e dispensada para os estrangeiros e os maiores de 45 anos no ato da habilitação; 
VI.	Comprovante de residência recente; 
VII.	Histórico Escolar do Ensino Médio;
VIII.	Certificado de Conclusão do Ensino Médio ou Diploma de Conclusão do Ensino Técnico integrado ao Médio em cursos regulares ou na modalidade de Educação de Jovens e Adultos; ou Certificado de Conclusão que comprove que o candidato concluiu o Ensino Médio com base no resultado do Exame Nacional do Ensino Médio - ENEM, do Exame Nacional para Certificação de Competências de Jovens e Adultos - ENCCEJA ou de exames de certificação de competência ou de avaliação de jovens e adultos realizados pelos sistemas estaduais de ensino;

